import React from "react";
import HeroImg from "../assets/backgroundimg.png";

function HeroSection() {
  return (
    <div
      style={{
        backgroundImage: `url(${HeroImg})`,
        height: "75vh",
        width: "100%",
        display: "flex",
        flexDirection: "column",
        justifyContent: "center",
        alignItems: "center",
      }}
    >
      <h1>How our service will work</h1>
      <div
        style={{
          display: "flex",
        }}
      >
        <div
          style={{
            backgroundColor: "black",
            width: "50%",
            heignt: "10vh",
            shadowColor: "#000",
            shadowOffset: { width: 0, height: 2 },
            shadowOpacity: 0.1,
            shadowRadius: 8,
            elevation: 2,
          }}
        >
          <h1
            style={{
              color: "white",
            }}
          >
            ff
          </h1>
        </div>
        <div
          style={{
            backgroundColor: "black",
            width: "20%",
            height: "10vh",
          }}
        >
          <h1>ff</h1>
        </div>
      </div>
    </div>
  );
}

export default HeroSection;
